import React from 'react';
import './css/CreateMovie.css'

import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';
import InputLabel from '@material-ui/core/InputLabel';
import { makeStyles } from '@material-ui/core/styles';
import MenuItem from '@material-ui/core/MenuItem';
import Select from '@material-ui/core/Select';

import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Slider from '@material-ui/core/Slider';

const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
}));

const handlerChange = () => {

}

const CreateMovie = () => {
    const classes = useStyles();
    const [value, setValue] = React.useState('Controlled');

    return (
        <div id="content">
            <h1><span>Add Movie</span></h1>
            <FormControl style={{ margin: "20px", padding: "15px" }}>
                <div>
                    <TextField
                        style={{ width: "400px" }}
                        type="text"
                        id="outlined-secondary"
                        label="Movie Title"
                        variant="outlined"
                        name="title"
                        value={handlerChange}

                    />
                    <TextField
                        style={{
                            marginLeft: "100px",
                            width: "400px"
                        }}
                        type="number"
                        id="outlined-secondary"
                        label="Year"
                        variant="outlined"
                        name="year"
                        value={handlerChange}
                    />
                </div>
                <div style={{ marginTop: "20px" }}>
                    <TextField
                        style={{ width: "400px" }}
                        id="outlined-multiline-static"
                        label="Description"
                        multiline
                        rows={4}
                        variant="outlined"
                        name="description"
                        value={handlerChange}
                    />

                    <TextField
                        style={{ marginLeft: "100px", width: "400px" }}
                        type="number"
                        id="outlined-secondary"
                        label="Duration"
                        variant="outlined"
                        name="duration"
                        value={handlerChange}
                    />
                </div>
                <div style={{ marginTop: "20px" }}>
                    <TextField
                        style={{ width: "400px" }}
                        type="number"
                        id="outlined-secondary"
                        label="Genre"
                        variant="outlined"
                        name="genre"
                        value={handlerChange}
                    />

                    <TextField
                        style={{ marginLeft: "100px", width: "400px" }}
                        type="number"
                        id="outlined-secondary"
                        label="Rating"
                        variant="outlined"
                        min={0}
                        max={10}
                        name="rating"
                        value={handlerChange}
                    />
                </div>
                <div style={{ marginTop: "20px" }}>
                    <Typography id="discrete-slider" gutterBottom>
                        Rating
                     </Typography>
                    <Slider
                        defaultValue={5}
                        getAriaValueText=""
                        aria-labelledby="discrete-slider"
                        valueLabelDisplay="auto"
                        step={0.5}
                        marks
                        min={0}
                        max={10}
                        style={{ width: "400px" }}
                    />

                    <TextField
                        style={{ marginLeft: "100px", width: "400px" }}
                        id="outlined-multiline-static"
                        label="Review"
                        multiline
                        rows={4}
                        variant="outlined"
                    />
                </div>
                <div style={{ marginTop: "20px" }}>
                    <TextField
                        style={{ width: "400px" }}
                        type="text"
                        id="outlined-secondary"
                        label="Movie Image (URL):"
                        variant="outlined"

                    />
                </div>
                <div style={{ marginTop: "20px" }}>
                    <Button variant="contained" color="secondary">
                        Submit
                    </Button>
                </div>
            </FormControl >
        </div >
    )
}
export default CreateMovie;
